import { Grid } from "@material-ui/core";
import React from "react";
import { MTableBodyRow } from "material-table";
const CustomRow= (props)=>{
    return <Grid style={{display:'contents'}}>
        <MTableBodyRow {...props} />
    </Grid>

}

export default CustomRow;
